    TResult? Function(InvalidAmountFormat value)? invalidAmountFormat,
    TResult? Function(EmptyExpenseDescription value)? emptyExpenseDescription,
    TResult? Function(InvalidColor value)? invalidColor,
  }) {
    return invalidColor?.call(this);
  }

  @override
  @optionalTypeArgs
  TResult maybeMap<TResult extends Object?>({
    TResult Function(InvalidEmail value)? invalidEmail,
    TResult Function(EmptyEmail value)? emptyEmail,
    TResult Function(ShortPassword value)? shortPassword,
    TResult Function(ShortName value)? shortName,
    TResult Function(LongName value)? longName,
    TResult Function(PasswordsDoNotMatch value)? passwordsDoNotMatch,
    TResult Function(EmptyGroupName value)? emptyGroupName,
    TResult Function(EmptyGroupToken value)? emptyGroupToken,
    TResult Function(EmptyAmount value)? emptyAmount,
    TResult Function(InvalidAmount value)? invalidAmount,
    TResult Function(InvalidAmountFormat value)? invalidAmountFormat,
    TResult Function(EmptyExpenseDescription value)? emptyExpenseDescription,
    TResult Function(InvalidColor value)? invalidColor,
    required TResult orElse(),
  }) {
    if (invalidColor != null) {
      return invalidColor(this);
    }
    return orElse();
  }
}

abstract class InvalidColor implements InputDataFailure {
  const factory InvalidColor() = _$InvalidColor;
}
